import React from "react";
import 'bootstrap/dist/css/bootstrap.min.css';
import {Container, Row, Col,Card, Button,Navbar, Nav} from 'react-bootstrap';


function Navbarteam()
{
  return(
<div>
<Navbar bg="light" expand="lg" variant="light">
            {/*<Link to="/">*/}
            <Navbar.Brand style={{fontFamily:"Raleway",fontWeight:"bold"}}>THE DATA ANECDOTES</Navbar.Brand>{/*</Link>*/}
            <Navbar.Toggle aria-controls="responsive-navbar-nav" />
            <Navbar.Collapse id="responsive-navbar-nav">
            <Nav className="ml-auto">
           <div className="navitem"> <a href="#" >Home</a></div>
           <div className="navitem"><a href="#">Stories</a></div>
           <div className="navitem"><a href="#">Our Team</a></div>
           <div className="navitem"> <a href="#">Contact Us</a></div>





            </Nav>
            </Navbar.Collapse>

        </Navbar>
        </div>
  );
}

export default Navbarteam;
